import { Box, Chip, MenuItem, Select, TextField } from '@mui/material'
import React, { useState,useEffect } from 'react'
import axios from 'axios';
import { Grid } from '@mui/material'

const TEST = () => {

const [data,setData] = useState([])


  useEffect(() => {
    let isApicancel = true

    axios.get('http://localhost/REACTJS/cognate1%20api/ProductdataAPI.php')
    .then(res=>{
      
      if (isApicancel)
      {
        setData(res.data)

      }
    
      
     })

    //  pangcancel ng reqest pag di naka open
     return () => isApicancel = false
  })
 const image = data.filter(e=>e.Product_ID === 2379).map(e=>e.Product_image)
  return (
    <div>

      {data.map(e=>{
// {/* Container Logo */}
        <Grid
        key={e.Product_ID}
        item 
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        xs={12} md={6}>


{/* Picture box */}       
          <Box
          fixed
          component='img'
          sx={{
            width: '90%',
            height: 'auto',
            maxHeight: { xs: 'auto', md: 'auto' },
            maxWidth: { xs: 300, md: '90%' },
          }}
          // src={LOGO}
          >
          {}
          </Box>
          {e.Product_name}
          </Grid>
   
      })
      
      }

    





    </div>
  )
}

export default TEST
